import React from 'react';
import Nevbar from './Navbar'
import './App.css'

const App = () => {
  return (
    <div className='body-App'>
      <Nevbar />
      <h1>Insert Data</h1>
      <InputForm />
      <h1>Students Infomation</h1>
      <StudentList />
    </div>
  );
}

export default App;
